import { useState } from 'react';
import { Link } from 'react-router-dom';
import BtnSubmit from '../../components/BtnSubmit';
import FormInput from '../../components/FormInput';
import { Container, Footer, Form, Header, Section, Title } from './styles';

const CreateAccount: React.FC = () => {
  const [nome, setNome] = useState('');
  const [cpf, setCpf] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [pass, setPass] = useState('');
  const [confirmPass, setConfirmPass] = useState('');
  return (
    <Container>
      <Header>
        <img src='/assets/imgs/logo-horizontal.svg' alt='' />
      </Header>
      <Section>
        <div className='top'>
          <img src='/assets/imgs/vga.svg' alt='' />
          <Title className='title'>Criar conta</Title>
        </div>
        <Form>
          <FormInput label={'nome'} value={nome} />
          <FormInput label={'cpf'} value={cpf} />
          <FormInput label={'telefone'} value={phone} />
          <FormInput label={'email'} value={email} />
          <FormInput label={'senha'} value={pass} />
          <FormInput label={'Confirmar senha'} value={confirmPass} />
          <BtnSubmit text={'Criar'} />
        </Form>
      </Section>
      <Footer>
        <p>SILLICON STORE - VAREJO DE PRODUTOS DE INFORM√ÅTICA LTDA</p>
        <Link to={'/'}>TERMOS E PRIVACIDADE</Link>
      </Footer>
    </Container>
  );
};

export default CreateAccount;
